import { Searchbar } from 'react-native-paper';

export default function SearchBar() {
  const { inputs, handleChange, clearForm, resetForm } = useForm({
    keyword: ''
  });

  return (
    <Searchbar
      placeholder="Search"
      onChangeText={handleChange}
      value={inputs}
    />
  );
}
